
SELECT MAX("actors"."actorid") as agg_0 FROM "directors" LEFT OUTER JOIN "movies2directors" ON "directors"."directorid" = "movies2directors"."directorid" LEFT OUTER JOIN "movies" ON "movies2directors"."movieid" = "movies"."movieid" LEFT OUTER JOIN "u2base" ON "movies"."movieid" = "u2base"."movieid" LEFT OUTER JOIN "movies2actors" ON "movies"."movieid" = "movies2actors"."movieid" LEFT OUTER JOIN "actors" ON "movies2actors"."actorid" = "actors"."actorid"  WHERE "u2base"."movieid" BETWEEN 1681552 AND 1712173 AND "movies2actors"."movieid" >= 1764352 AND "actors"."actorid" >= 181927 AND ("directors"."d_quality" <= 4 OR ("directors"."d_quality" >= 4 AND "directors"."d_quality" BETWEEN 4 AND 5)) AND "movies2actors"."actorid" <= 511053;